func nearestExit(maze [][]byte, entrance []int) int {

	candi := [][]int{{entrance[0], entrance[1]}}
	step := 0
	maze[entrance[0]][entrance[1]] = byte('+')
	for len(candi) > 0 {
		t := [][]int{}
		for i := 0; i < len(candi); i++ {
			x, y := candi[i][0], candi[i][1]
			if (x == 0 || x == len(maze)-1 || y == 0 || y == len(maze[0])-1) && step != 0 {
				return step
			}
			
			cord := [][]int{{1, 0}, {-1, 0}, {0, -1}, {0, 1}}
			for _, v := range cord {
				r, c := v[0], v[1]
				if x+r >= 0 && x+r < len(maze) && y+c >= 0 && y+c < len(maze[0]) && maze[x+r][y+c] == byte('.') {
					maze[x + r][y + c] = byte('+')
					t = append(t, []int{x + r, y + c})
				}
			}
		}
		step++
		candi = t
		// fmt.Println(step, len(candi))
	}

	return -1
}

